INSERT INTO `app_course_sub` (`id`, `title`, `image`, `course_id`, `content`, `allow_class`, `created_date`, `created_by`, `modified_date`, `modified_by`, `is_free`, `publish`) VALUES
(9, 'Irrigation Fresh Pineapple Plantation', '682d96ae0a1b9.jpg', 13, '<p>Kompetensi <strong data-start=\"15\" data-end=\"29\">Irrigation</strong> mencakup keterampilan dalam menyiapkan dan mengoperasikan sistem irigasi secara efektif. Kompetensi ini meliputi pemasangan mesin dan pompa air, instalasi pipa serta irigator, pengoperasian unit irigasi, pengecekan berkala, penerapan 5R, pemadaman sistem, troubleshooting, dan pelaporan hasil kerja untuk memastikan efisiensi serta keberlanjutan irigasi.</p>', '', '2025-03-19 09:21:24', 240, '2025-05-21 16:02:38', 240, 0, 1),
(11, 'Irrigation Banana Plantation', '682d969c28c1b.jpg', 13, '<p>Kompetensi <strong data-start=\"15\" data-end=\"29\">Irrigation</strong> mencakup keterampilan dalam menyiapkan dan mengoperasikan sistem irigasi secara efektif. Kompetensi ini meliputi pemasangan mesin dan pompa air, instalasi pipa serta irigator, pengoperasian unit irigasi, pengecekan berkala, penerapan 5R, pemadaman sistem, troubleshooting, dan pelaporan hasil kerja untuk memastikan efisiensi serta keberlanjutan irigasi.</p>', '', '2025-03-19 13:18:23', 240, '2025-05-21 16:02:20', 240, 0, 1),
(12, 'Irrigation Processed Pineapple Plantation', '682d96fb3b1fa.jpg', 13, '<p>Kompetensi <strong data-start=\"15\" data-end=\"29\">Irrigation</strong> mencakup keterampilan dalam menyiapkan dan mengoperasikan sistem irigasi secara efektif. Kompetensi ini meliputi pemasangan mesin dan pompa air, instalasi pipa serta irigator, pengoperasian unit irigasi, pengecekan berkala, penerapan 5R, pemadaman sistem, troubleshooting, dan pelaporan hasil kerja untuk memastikan efisiensi serta keberlanjutan irigasi.</p>', '', '2025-03-19 13:44:31', 240, '2025-05-21 16:03:55', 240, 0, 1),
(13, 'Irrigation Guava Plantation', '682d96b945a70.webp', 13, '<p>Kompetensi <strong data-start=\"15\" data-end=\"29\">Irrigation</strong> mencakup keterampilan dalam menyiapkan dan mengoperasikan sistem irigasi secara efektif. Kompetensi ini meliputi pemasangan mesin dan pompa air, instalasi pipa serta irigator, pengoperasian unit irigasi, pengecekan berkala, penerapan 5R, pemadaman sistem, troubleshooting, dan pelaporan hasil kerja untuk memastikan efisiensi serta keberlanjutan irigasi.</p>', '', '2025-03-20 15:41:06', 240, '2025-05-21 16:02:49', 240, 0, 1),
(14, 'Irrigation Others Fruit Plantation', '682d96f1330d4.jpg', 13, '<p>Kompetensi&nbsp;<strong data-start=\"15\" data-end=\"29\">Irrigation</strong>&nbsp;mencakup keterampilan dalam menyiapkan dan mengoperasikan sistem irigasi secara efektif. Kompetensi ini meliputi pemasangan mesin dan pompa air, instalasi pipa serta irigator, pengoperasian unit irigasi, pengecekan berkala, penerapan 5R, pemadaman sistem, troubleshooting, dan pelaporan hasil kerja untuk memastikan efisiensi serta keberlanjutan irigasi.</p>', '', '2025-03-24 10:58:30', 241, '2025-05-21 16:03:45', 240, 0, 1);
