(194, '<p>Alat yang berfungsi untuk menyambungkan 2 komponen pipa yang memiliki ukuran berbeda adalah?</p>', 7, '', '<p>A. Reducer&nbsp;</p>', '<p>B. Gearbox&nbsp;</p>', '<p>C. Koyak&nbsp;</p>', '<p>D. Flowmeter&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 2, 1),
