(196, '<p>Apa fungsi kontak accu/baterai pada mesin irigasi?</p>', 7, '', '<p>A. Memutus dan menyambung arus listrik&nbsp;</p>', '<p>B. Mengalirkan listrik&nbsp;</p>', '<p>C. Mengalirkan air&nbsp;</p>', '<p>D. Mengalirkan bahan bakar&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 4, 1),
(197, '<p>Apa fungsi seal karet (perpak) yang terdapat diantara plank?</p>', 7, '', '<p>A. Mengurangi getaran&nbsp;</p>', '<p>B. Mencegah kebocoran&nbsp;</p>', '<p>C. Mencegah kerusakan pipa&nbsp;</p>', '<p>D. Semua benar&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 5, 1),
(198, '<p>Berapa ukuran pipa main line?&nbsp;</p>', 7, '', '<p>A. 5 inch&nbsp;</p>', '<p>B. 3 inch&nbsp;</p>', '<p>C. 4 inch&nbsp;</p>', '<p>D. 6 inch&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 6, 1),
(199, '<p>Berapa ukuran valve submain?&nbsp;</p>', 7, '', '<p>A. 5 inch&nbsp;</p>', '<p>B. 3 inch&nbsp;</p>', '<p>C. 4 inch&nbsp;</p>', '<p>D. 6 inch&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 7, 1),
(200, '<p>Apa jenis selang yang digunakan untuk siram tanaman Mangga, Lemon dan Citra?</p>', 7, '', '<p>A. Pipa PVC&nbsp;</p>', '<p>B. Pipa Galvanish</p>', '<p>C. Pipa HDPE&nbsp;</p>', '<p>D. Selang drip&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 8, 1),
(201, '<p>Apa tugas operator ketika instalasi selesai dipasang?&nbsp;</p>', 7, '', '<p>A. Mengisi LHO&nbsp;</p>', '<p>B. Pengecekan kebocoran / flushing&nbsp;</p>', '<p>C. Menunggu gubuk irigasi&nbsp;</p>', '<p>D. Mengukur kedalaman lebung&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 9, 1),
(202, '<p>Berapa ukuran pipa yang tidak dipakai untuk instalasi pipa di Other Fresh Fruit?</p>', 7, '', '<p>A. 5 inch&nbsp;</p>', '<p>B. 3 inch&nbsp;</p>', '<p>C. 4 inch&nbsp;</p>', '<p>D. 6 inch&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 10, 1),
(203, '<p>Apa nama konektor selang dengan pipa?</p>', 7, '', '<p>A. Valve&nbsp;</p>', '<p>B. Flange&nbsp;</p>', '<p>C. Progrip Tape Tee&nbsp;</p>', '<p>D. Lem Kubota&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 11, 1),
(204, '<p>&nbsp;Apa fungsi Valve?&nbsp;</p>', 7, '', '<p>A. Kran buka/tutup air&nbsp;</p>', '<p>B. Penyambung antar pipa&nbsp;</p>', '<p>C. Penghubung atar pipa ukuran berbeda&nbsp;</p>', '<p>D. Perekat&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 12, 1),
(205, '<p>Apa fungsi Reducer?</p>', 7, '', '<p>A. Kran buka/tutup air&nbsp;</p>', '<p>B. Penyambung antar pipa&nbsp;</p>', '<p>C. Penghubung atar pipa ukuran berbeda&nbsp;</p>', '<p>D. Perekat&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 13, 1),
(206, '<p>Apa fungsi Flange?</p>', 7, '', '<p>A. Kran buka/tutup air&nbsp;</p>', '<p>B. Penyambung antar komponen instalasi irigasi&nbsp;</p>', '<p>C. Penghubung atar pipa ukuran berbeda&nbsp;</p>', '<p>D.Perekat&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 14, 1),
(207, '<p>Berikut yang bukan termasuk material yang dipakai dalam proses pasang instalasi irigasi...</p>', 7, '', '<p>A. Pipa 5 inch&nbsp;</p>', '<p>B. Lem&nbsp;</p>', '<p>C. Selang&nbsp;</p>', '<p>D. Solar&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 15, 1),
(208, '<p>Berapa Standar siram yang digunakan untuk tanaman Pepaya berbuah?&nbsp;</p>', 7, '', '<p>A. 3 mm&nbsp;</p>', '<p>B. 5 mm&nbsp;</p>', '<p>C. 7 mm&nbsp;</p>', '<p>D. 10 mm&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 16, 1),
(209, '<p>Berapa Standar siram yang digunakan untuk tanaman pepaya umur 4-5 bulan?&nbsp;</p>', 7, '', '<p>A. 3 mm&nbsp;</p>', '<p>B. 5 mm&nbsp;</p>', '<p>C. 7 mm&nbsp;</p>', '<p>D. 10 mm&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 17, 1),
(210, '<p>Berapa Standar siram yang digunakan untuk tanaman Mangga, Citra, Markisa dan Lemon secara umum?</p>', 7, '', '<p>A. 3 mm&nbsp;</p>', '<p>B. 5 mm&nbsp;</p>', '<p>C. 7 mm&nbsp;</p>', '<p>D. 10 mm&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 18, 1),
(211, '<p>Proses yang bukan untuk dilakukan pada saat akan menghidupkan mesin:&nbsp;</p>', 7, '', '<p>A. Cek accu&nbsp;</p>', '<p>B. Cek oli&nbsp;</p>', '<p>C. Cek valve&nbsp;</p>', '<p>D.Cek solar&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 19, 1),
(212, '<p>5,7 jam dalam pengoperasian mesin irigasi artinya...</p>', 7, '', '<p>A. 57 jam&nbsp;</p>', '<p>B. 5 jam 7 menit&nbsp;</p>', '<p>C. 5 jam 70 menit&nbsp;</p>', '<p>D. 5 jam 47 menit&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 20, 1),
(213, '<p>Sebagai seorang operator irigasi, yang dilakukan jika volume irigasi belum tercapai pada waktu yang sudah di tentukan adalah...</p>', 7, '', '<p>A. Lanjutkan siram&nbsp;</p>', '<p>B. Matikan mesin / Lapor ke atasan&nbsp;</p>', '<p>C. Naikkan RPM&nbsp;</p>', '<p>D. Pindah lokasi&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 21, 1),
(214, '<p>Apa kerugiaan bagi perusahaan jika dalam bekerja dibidang irigasi terdapat banyak kebocoran pipa, banyak kebuntuan selang seawon, atau flow meter tidak tersedia, kecuali?</p>', 7, '', '<p>A. Produktivitas turun&nbsp;</p>', '<p>B. Biaya naik&nbsp;</p>', '<p>C. Siram tidak sesuai&nbsp;</p>', '<p>D. Tidak ada kerugian&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 22, 1),
(215, '<p>Kenapa mesin dihidupkan dulu selama 5 menit?&nbsp;</p>', 7, '', '<p>A. Supaya oli melumasi semua komponen mesin&nbsp;</p>', '<p>B. Agar air naik&nbsp;</p>', '<p>C. Supaya solar habis&nbsp;</p>', '<p>D. Agar pipa tidak bocor&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 23, 1),
(216, '<p>Yang perlu dicatat oleh operator dalam lembar LHO, kecuali...</p>', 7, '', '<p>A. RPM&nbsp;</p>', '<p>B. Kelembapan tanah&nbsp;</p>', '<p>C. Suhu Mesin&nbsp;</p>', '<p>D. Jam Mesin&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 24, 1),
(217, '<p>Secara teoritis/perhitungan jika air terbaca&nbsp; dalam flowmeter terkirimkan sebesar 160m3 ke area sebesar 2Ha ( 1 Ha = 100m x 100m).&nbsp; &nbsp;berapakah mm ketebalan siramnya selama 2 jam ? ( 0.001m = 1mm)&nbsp;</p>', 7, '', '<p>A. 16 mm&nbsp;</p>', '<p>B. 12 mm&nbsp;</p>', '<p>C. 10 mm</p>', '<p>D. 5 mm&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 25, 1),
(218, '<p>Apa yang harus di isi oleh operator setelah selesai kerja?&nbsp;</p>', 7, '', '<p>A. Oli&nbsp;</p>', '<p>B. Air Radiator&nbsp;</p>', '<p>C. Solar&nbsp;</p>', '<p>D. Laporan Hasil Operator (LHO)&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 26, 1),
(219, '<p>Jika ditemukan pipa bocor saat melakukan pengetesan air / flushing, apa yang harus dilakukan?&nbsp;</p>', 7, '', '<p>A. Lapor atasan&nbsp;</p>', '<p>B. Dibiarkan saja&nbsp;</p>', '<p>C. Matikan mesin&nbsp;</p>', '<p>D. Beri Penanda dan segera dilakukan perbaikan&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 27, 1),
(220, '<p>Apa yang harus dilakukan maintenance saat mesin sudah mulai bekerja?&nbsp;</p>', 7, '', '<p>A. Pengecekan jalur pipa&nbsp;</p>', '<p>B. Pengecekan selang&nbsp;</p>', '<p>C. Pengecekan sambungan&nbsp;</p>', '<p>D. Benar Semua&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 28, 1),
(221, '<p>Apa yang terjadi jika kebocoran pada pipa tidak segera dilakukan perbaikan?</p>', 7, '', '<p>A. Pressure turun&nbsp;</p>', '<p>B. Tebal siram tidak terpenuhi&nbsp;</p>', '<p>C. Terjadi genangan&nbsp;</p>', '<p>D. Semua Benar&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 29, 1),
(222, '<p>Apa tujuan dari pengecekan hasil instalasi Irigasi dengan mengalirkan air?&nbsp;</p>', 7, '', '<p>A. Untuk mendeteksi kebocoran / kerusakan pipa&nbsp;</p>', '<p>B. Memanaskan mesin&nbsp;</p>', '<p>C. Membuat laporan&nbsp;</p>', '<p>D. Benar semua&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 30, 1),
(223, '<p>Apakah yang perlu dilakukan terhadap penangan sampah organik dan non organik yang ada di area kerja irigasi?&nbsp;</p>', 7, '', '<p>A. Dibakar dekat gubuk irigasi&nbsp;</p>', '<p>B. Diletakkan di pojok gubuk&nbsp;</p>', '<p>C. Ditempatkan pada tempat sampah dan dibuang ke TPA secara berkala&nbsp;</p>', '<p>D. Diselipkan pada area yang tidak terlihat&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 31, 1),
(224, '<p>Apakah yang perlu dilakukan pada tumpukan kunci, ember, wadah bekas minuman, dan cangkul yang menumpuk pada satu area?&nbsp;</p>', 7, '', '<p>A. Ditutupi oleh karung&nbsp;</p>', '<p>B. Dimasukkan menjadi satu ke dalam sebuah karung&nbsp;</p>', '<p>C. Ditempatkan sesuai jenisnya dan dibuang apabila tidak digunakan&nbsp;</p>', '<p>D. Dibiarkan saja&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'C', 1, 32, 1),
(225, '<p>Hal-hal yang tidak boleh dilakukan pada area irigasi dan berhubungan dengan 5R adalah...</p>', 7, '', '<p>A. Makan dan minum&nbsp;</p>', '<p>B. Berdiskusi dan Menyusun rencana kerja&nbsp;</p>', '<p>C. Memperbaiki kendaraan pribadi&nbsp;</p>', '<p>D. Meletakkan kunci kerja di bawah engine&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'D', 1, 33, 1),
(226, '<p>Dari beberapa hal yang tidak sesuai dibawah ini, kondisi manakah yang perlu dikerjakan terlebih dahulu?&nbsp;</p>', 7, '', '<p>A. Sampah berserakan&nbsp;</p>', '<p>B. Kabel Listrik yang terkelupas&nbsp;</p>', '<p>C. Alat kerja yang berantakan&nbsp;</p>', '<p>D. Dokumen kerja yang tidak tersusun&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 34, 1);
