(227, '<p>Salah satu bentuk penerapan R2 (Rapi) yaitu...&nbsp;</p>', 7, '', '<p>A. Menentukan area kerja&nbsp;</p>', '<p>B. Menyusun dan menyimpan item/perangkat kerja yang sering digunakan secara aman dan mudah dijangkau&nbsp;</p>', '<p>C. Penghijauan di area kerja dan mesin&nbsp;</p>', '<p>D. Pengecatan gubuk dan unit secara menyeluruh&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'B', 1, 35, 1),
(228, '<p>Kenapa tidak boleh mematikan engine pada kondisi RPM tinggi?</p>', 7, '', '<p>A. Menyebabkan kerusakan&nbsp;</p>', '<p>B. Pemborosan bahan bakar&nbsp;</p>', '<p>C. Pemborosan accu listrik&nbsp;</p>', '<p>D. A,b,c benar semua&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 36, 1),
