(242, '<p>Berapa ketebalan siram tanaman pada tanaman di Other Fruit khususnya saat mulai menghasilkan...</p>', 7, '', '<p>A. &gt;= 7 mm&nbsp;</p>', '<p>B. 2 mm&nbsp;</p>', '<p>C. 5 mm&nbsp;</p>', '<p>D. 4 mm&nbsp;</p>', '', NULL, NULL, NULL, NULL, NULL, 'A', 1, 50, 1);
