(19, 'services4-555bc7aa3edf1-5566517929ef2.png', 'Ahlak Mulia', 'Terwujudnya peserta didik SMK PGRI 1 Bangkalan berbudi pekerti berahlak pada setiap pelajaran.', '', '', '2015-05-28', 'ahlak-mulia', '', 2),
